		a_3__shared_input <= 1'b0;
		b_0__shared_input <= 1'b0;
		b_1__shared_input <= 1'b0;
		b_2__shared_input <= 1'b0;
		b_3__shared_input <= 1'b0;
		cin_shared_input <= 1'b0;

		cout_flag[0] <= 1'b0;
		sum_0__flag[0] <= 1'b0;
		sum_1__flag[0] <= 1'b0;
		sum_2__flag[0] <= 1'b0;
		sum_3__flag[0] <= 1'b0;
	end

